DESCRIPTION:
Praėjo mėnuo laiko nuo pranešimo ir atsakymo, kad perduota sutvarkyti. Iki šiol nei vienas šviestuvas nesutvarkytas, kodėl nereaguoja net po pranešimų, kai turėtų ir pati įmonė tikrinti ir tvarkyti profilaktiškai.
&#34;Parke neveikia nemažai šviestuvų, kurie apšviečia medžius, takelius pėstiesiems.
Taip pat neveikia dalis terasos virš upės apšvietimo.&#34;

Laba diena, gyvenu Albanų gatvėje, Kalnėnai. Rašau pakartotinai, gatvė ir gatvės apšvietimas yra tikrai perduotas miestui, taip mane informavo įmonės UAB &#34;Pakrantės būstas&#34; atstovas, kuri ir yra perdavusi miestui gatvę ir apšvietimą. Gatvėje neveikia nei vienas gatvės šviestuvas, kada planuojama sutvarkyti gedimą? Atsakymą norėčiau gauti elektroniniu paštu.

